import React from 'react'

function Nav() {
    return (
        <div className="nav">
            <img class="nav_logo"
            src="https://upload.wikimedia.org/wikipedia/commons/0/08/Netflix_2015_logo.svg"
            alt="Netflix Logo"
            />
            
        </div>
    )
}

export default Nav
